import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 54.1-3515 Certification renewal of individuals who became certified under the provisions of § 54.1-3514.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3515.md","filePath":"vacode/54.1-3515.md"}'),a={name:"vacode/54.1-3515.md"},o=r('<h1 id="§-54-1-3515-certification-renewal-of-individuals-who-became-certified-under-the-provisions-of-§-54-1-3514" tabindex="-1">§ 54.1-3515 Certification renewal of individuals who became certified under the provisions of § 54.1-3514. <a class="header-anchor" href="#§-54-1-3515-certification-renewal-of-individuals-who-became-certified-under-the-provisions-of-§-54-1-3514" aria-label="Permalink to &quot;§ 54.1-3515 Certification renewal of individuals who became certified under the provisions of § 54.1-3514.&quot;">​</a></h1><p>After July 1, 2001, the Board of Counseling shall not renew a certificate to any person who became certified under the provisions of § <a href="http://law.lis.virginia.gov/vacode/54.1-3514/" target="_blank" rel="noreferrer">54.1-3514</a> without documentation that such person meets the current requirements for certification established by the Board, unless such person provided rehabilitation services for at least two years immediately preceding July 1, 1997, and has done so continuously since that date without interruption and received a passing score on a Board approved examination. The Board of Counseling, pursuant to its authority in this section and in § <a href="http://law.lis.virginia.gov/vacode/54.1-3505/" target="_blank" rel="noreferrer">54.1-3505</a>, shall adopt regulations to implement the 1997 revisions of the law relating to certified rehabilitation providers in 280 days or less of the date of the enactment of such revisions.</p><p>1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0839" target="_blank" rel="noreferrer">839</a>; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0609" target="_blank" rel="noreferrer">609</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0473" target="_blank" rel="noreferrer">473</a>.</p>',3),n=[o];function s(c,l,d,f,h,p){return i(),t("div",null,n)}const _=e(a,[["render",s]]);export{v as __pageData,_ as default};
